<template>
  <div>
    <div class="mb-2">
      <el-button
        type="primary"
        size="mini"
        icon="el-icon-download"
        @click="generatePDF()"
      >
        Download
      </el-button>
    </div>
    <div v-loading="dataLoading">
      <el-row>
        <el-col :span="24">
          <div id="pdfContainer" class="pdfContainer"></div>
        </el-col>
      </el-row>
    </div>
  </div>
</template>

<script>
import is from 'is_js';
import pdfMake from 'pdfmake/build/pdfmake';
// import pdfFonts from 'pdfmake/build/vfs_fonts';
// pdfMake.vfs = pdfFonts.pdfMake.vfs;
pdfMake.fonts = {
  Montserrat: {
    normal: 'https://fppghana.com/fonts/Raleway-Regular.ttf',
    bold: 'https://fppghana.com/fonts/Raleway-Bold.ttf',
    italics: 'https://fppghana.com/fonts/Raleway-Italic.ttf',
    bolditalics: 'https://fppghana.com/fonts/Raleway-MediumItalic.ttf',
  },
};

export default {
  name: 'ProfileDownload',
  props: {
    farmer: Object,
  },
  data() {
    return {
      dataLoading: false,
      harvestInfo: [],
      incomeInfo: [],
      supportsInfo: [],
      hasSupports: false,
    };
  },
  created() {
    this.loadData();
  },
  methods: {
    loadData() {
      this.dataLoading = true;
      this.incomeInfo = [];
      this.harvestInfo = [];
      this.supportsInfo = [];
      this.hasSupports = this.hasInputSupport(this.farmer.inputSupports);

      this.addHarvestInfoItem(this.farmer.harvestYield[0].years);

      this.addIncomeInfoItem(this.farmer.harvestYield[0].years);

      if (this.hasSupports === 1 || this.hasSupports === true) {
        this.addSupportInfoItem(this.farmer.inputSupports);
      } else {
        this.addSupportInfoItem([
          {
            year: '2020',
            grand_total: 0,
          },
        ]);
      }
      this.embedPDF();
    },
    getTableTitle(title) {
      return {
        width: 500,
        stack: [
          {
            text: title,
            style: 'titleHead',
          },
        ],
      };
    },

    // Harvest table items
    addHarvestInfoItem(harvest) {
      harvest.push({
        year: '2022',
        major_season_harvest: 0,
        minor_season_harvest: 0,
        yearly_harvest: 0,
      });
      this.harvestInfo.push(
        this.addColSpan('Yield for Production Year [50kg/bag]')
      );
      this.harvestInfo.push([
        {
          text: 'Season',
          fontSize: 14,
          bold: true,
          alignment: 'center',
          margin: [0, -10, 0, 0],
          border: [true, false, true, true],
        },
        {
          text: harvest[0].year,
          bold: true,
          fontSize: 14,
          alignment: 'center',
        },
        {
          text: harvest[1].year,
          bold: true,
          fontSize: 14,
          alignment: 'center',
        },
      ]);
      this.harvestInfo.push([
        { text: 'Major', alignment: 'center' },
        { text: harvest[0].major_season_harvest, alignment: 'center' },
        { text: harvest[1].major_season_harvest, alignment: 'center' },
      ]);
      this.harvestInfo.push([
        { text: 'Minor', alignment: 'center' },
        { text: harvest[0].minor_season_harvest, alignment: 'center' },
        { text: harvest[1].minor_season_harvest, alignment: 'center' },
      ]);
      this.harvestInfo.push([
        { text: 'Annual Total', bold: true, fontSize: 16, alignment: 'center' },
        { text: harvest[0].yearly_harvest, alignment: 'center' },
        { text: harvest[1].yearly_harvest, alignment: 'center' },
      ]);
    },

    // harvest Income table items
    addIncomeInfoItem(income) {
      income.push({
        year: '2022',
        major_season_income: 0,
        minor_season_income: 0,
        yearly_income: 0,
      });
      this.incomeInfo.push(this.addColSpan('Income for Production Year [GH₵]'));
      this.incomeInfo.push([
        {
          text: 'Season',
          fontSize: 14,
          bold: true,
          alignment: 'center',
          margin: [0, -10, 0, 0],
          border: [true, false, true, true],
        },
        { text: income[0].year, bold: true, fontSize: 14, alignment: 'center' },
        { text: income[1].year, bold: true, fontSize: 14, alignment: 'center' },
      ]);
      this.incomeInfo.push([
        { text: 'Major', alignment: 'center' },
        { text: income[0].major_season_income, alignment: 'center' },
        { text: income[1].major_season_income },
      ]);
      this.incomeInfo.push([
        { text: 'Minor', alignment: 'center' },
        { text: income[0].minor_season_income, alignment: 'center' },
        { text: income[1].minor_season_income },
      ]);
      this.incomeInfo.push([
        { text: 'Annual Total', bold: true, fontSize: 16 },
        { text: income[0].yearly_income, alignment: 'center' },
        { text: income[1].yearly_income, alignment: 'center' },
      ]);
    },

    // support table items
    addSupportInfoItem(support) {
      support.push({
        year: '2021',
        grand_total: 0,
      });
      this.supportsInfo.push(
        this.addColSpan('Support Value for Production Year [GH₵]')
      );
      this.supportsInfo.push([
        {
          text: 'Season',
          fontSize: 14,
          bold: true,
          alignment: 'center',
          margin: [0, -10, 0, 0],
          border: [true, false, true, true],
        },
        {
          text: support[0].year,
          bold: true,
          fontSize: 14,
          alignment: 'center',
        },
        {
          text: support[1].year,
          bold: true,
          fontSize: 14,
          alignment: 'center',
        },
      ]);
      this.supportsInfo.push([
        { text: 'Major', alignment: 'center' },
        { text: '-' },
        { text: '-' },
      ]);
      this.supportsInfo.push([
        { text: 'Minor', alignment: 'center' },
        { text: '-' },
        { text: '-' },
      ]);
      this.supportsInfo.push([
        { text: 'Annual Total', bold: true, fontSize: 16 },
        { text: support[0].grand_total, alignment: 'center' },
        { text: support[1].grand_total, alignment: 'center' },
      ]);
    },

    getLineCanvas() {
      return [
        {
          type: 'line',
          x1: 0,
          y1: 0,
          x2: 520,
          y2: 0,
          lineColor: 'black',
          lineWidth: 3,
        },
      ];
    },
    addColSpan(title) {
      return [
        { border: [true, true, true, false], text: '' },
        {
          text: title,
          alignment: 'center',
          fontSize: 14,
          bold: true,
          border: [true, true, true, true],
          colSpan: 2,
        },
        { border: [false, false, false, false], text: '' },
      ];
    },
    getFileName() {
      let farmer = is.existy(this.farmer.name)
        ? this.ucwords(this.farmer.name)
        : 'Not provided';
      return farmer + ' Profile';
    },
    getFPPDetails(detail) {
      let details = {
        name: 'Farmer Profile Platform',
        phone: '+233054 (059) 144-74-08',
        email: 'support@fppghana.com',
        website: 'www.cnmghana.com',
        address: '',
        cngLogo:
          'data:image/png;base64,',
        logo:
          'data:image/png;base64,',
      };
      return details[detail];
    },
    getDetails(detail) {
      let details = {
        tagline: 'INNOVATIVELY IMPROVING RURAL LIVES',
        penalty: '4%',
      };
      return details[detail];
    },
    getProfileDetails(detail) {
      let details = {
        name: this.farmer.name,
        phone: this.farmer.phone,
        email: is.empty(this.farmer.email) ? 'Not provided' : this.farmer.email,
        education: this.farmer.education,
        dob: this.getDateFormat(this.farmer.dob),
        hometown: this.farmer.hometown,
        nationality: this.farmer.nationality,
        residence: this.farmer.townOfResidence,
        national_id: this.farmer.national_id,
        id_number: this.farmer.id_number,
        fpp_id: this.farmer.farmerId,
        years_farming: this.farmer.years_farming,
        num_children: this.farmer.num_children,
        photo: this.getImageFile(this.farmer.photo),
        farm_location: this.farmer.farm_location,
        joined: this.getDateFormat(this.farmer.createdAt),
        marital_status: this.farmer.marital_status,
        crop: this.farmer.harvestYield[0].crop_name,
        crop_acres: this.farmer.harvestYield[0].acres,
      };
      return details[detail];
    },
    addTable(lineItems, show = true) {
      return show
        ? {
            style: 'tableStyle',
            table: {
              widths: [100, '*', 200, '*'],
              headerRows: 2,
              body: lineItems,
            },
          }
        : {};
    },
    getPdfDefinition() {
      let self = this;
      return {
        pageSize: 'A4',
        info: {
          title: this.getFileName(),
          author: this.getFPPDetails('name'),
          subject: 'Farmer Profile Platform',
          keywords: 'Farmer, Profile, Farm',
        },
        watermark: {
          text: 'FPP',
          opacity: 0.1,
        },
        header: '',
        footer: function(currentPage, pageCount) {
          return [
            {
              margin: [0, 10, 0, 0],
              canvas: self.getLineCanvas(),
            },
            {
              fontSize: 10,
              bold: true,
              text: self.getDetails('tagline'),
              alignment: 'center',
              margin: [0, 5, 0, 0],
            },
            {
              columns: [
                { width: '*', text: 'For Enquiries & Support:' },
                {
                  width: 'auto',
                  text: 'Call: ' + self.getFPPDetails('phone'),
                  link: 'tel:' + self.getFPPDetails('phone'),
                  color: 'green',
                },
                {
                  width: 'auto',
                  text: 'email: ' + self.getFPPDetails('email'),
                  link: 'mailto:' + self.getFPPDetails('email'),
                  color: 'green',
                },
                {
                  width: 'auto',
                  text: 'visit: ' + self.getFPPDetails('website'),
                  link: 'http://' + self.getFPPDetails('website'),
                  color: 'green',
                },
              ],
              columnGap: 10,
            },
            {
              fontSize: 10,
              text: 'Page ' + currentPage.toString() + ' of ' + pageCount,
              alignment: 'right',
              margin: [0, -9, 20, 0],
            },
          ];
        },
        pageBreakBefore: function(currentNode, followingNodesOnPage) {
          return (
            currentNode.headlineLevel === 1 && followingNodesOnPage.length === 0
          );
        },
        content: [
          // Top section
          {
            columns: [
              {
                image: this.getFPPDetails('cngLogo'),
                width: 150,
                alignment: 'left',
              },
              // {
              //   image: this.getFPPDetails('logo'),
              //   width: 70,
              //   alignment: 'left',
              // },
              {
                stack: [
                  {
                    fontSize: 20,
                    text: this.getProfileDetails('name'),
                    margin: [0, 0, 0, 5],
                  },
                  {
                    fontSize: 14,
                    text: this.getProfileDetails('residence'),
                    margin: [0, 0, 0, 5],
                  },
                  {
                    fontSize: 14,
                    text: this.getProfileDetails('fpp_id'),
                    margin: [0, 0, 0, 5],
                  },
                  {
                    fontSize: 14,
                    text: this.getProfileDetails('joined'),
                    margin: [0, 0, 0, 5],
                  },
                ],
                alignment: 'right',
              },
              {
                image: 'snow',
                width: 120,
                alignment: 'right',
              },
            ],
            style: 'topsection',
          },
          {
            fontSize: 20,
            decoration: 'underline',
            bold: true,
            text: 'FARMER REPORT',
            alignment: 'center',
          },
          {
            columns: [this.getTableTitle('Personal & Household Info')],
          },
          {
            canvas: this.getLineCanvas(),
          },
          {
            columns: [
              {
                width: 100,
                stack: [
                  {
                    margin: [0, 10, 0, 7],
                    bold: true,
                    text: 'Age:',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 7],
                    bold: true,
                    text: 'Education',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 7],
                    bold: true,
                    text: 'ID Type:',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 7],
                    bold: true,
                    text: 'ID Number:',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 7],
                    bold: true,
                    text: 'Mobile:',
                    fontSize: 12,
                  },
                ],
              },
              {
                width: 120,
                stack: [
                  {
                    fontSize: 12,
                    margin: [0, 10, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('dob'),
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('education'),
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('national_id'),
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('id_number'),
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('phone'),
                  },
                ],
              },
              {
                width: 120,
                stack: [
                  {
                    margin: [0, 10, 0, 3],
                    bold: true,
                    text: 'Marital Status:',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 3],
                    bold: true,
                    text: 'Number of Children:',
                    fontSize: 12,
                  },
                ],
              },
              {
                width: 100,
                stack: [
                  {
                    fontSize: 12,
                    margin: [0, 10, 0, 3],
                    text: this.getProfileDetails('marital_status'),
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 3],
                    text: this.getProfileDetails('num_children'),
                  },
                ],
              },
            ],
          },
          {
            columns: [this.getTableTitle('Farm Info')],
          },
          {
            canvas: this.getLineCanvas(),
          },
          {
            columns: [
              {
                width: 140,
                stack: [
                  {
                    margin: [0, 10, 0, 7],
                    bold: true,
                    text: 'Location:',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 7],
                    bold: true,
                    text: 'Total Farm-size:',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 7],
                    bold: true,
                    text: 'Key Cultivating Crops:',
                    fontSize: 12,
                  },
                  {
                    margin: [0, 0, 0, 7],
                    bold: true,
                    text: 'GPS:',
                    fontSize: 12,
                  },
                ],
              },
              {
                width: 120,
                stack: [
                  {
                    fontSize: 12,
                    margin: [0, 10, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('hometown'),
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('crop_acres') + ' acres',
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('crop'),
                  },
                  {
                    fontSize: 12,
                    margin: [0, 0, 0, 7],
                    bold: false,
                    text: this.getProfileDetails('farm_location'),
                  },
                ],
              },
            ],
          },
          {
            columns: [this.getTableTitle('Annual Harvest Yield')],
          },
          {
            canvas: this.getLineCanvas(),
          },
          self.addTable(self.harvestInfo),
          {
            columns: [this.getTableTitle('Annual Income')],
          },
          {
            canvas: this.getLineCanvas(),
          },
          self.addTable(self.incomeInfo),
          {
            columns: [this.getTableTitle('Annual Farm Input Support')],
          },
          {
            canvas: this.getLineCanvas(),
          },
          self.addTable(self.supportsInfo),
        ],
        images: {
          snow: this.getProfileDetails('photo'),
        },
        styles: {
          topsection: {
            margin: [0, 10, 0, 40],
          },
          tableStyle: {
            fontSize: 12,
            margin: [0, 5, 0, 15],
          },
          tableHeader: {
            bold: true,
            border: [false, false, false, false],
            margin: [10, 0, 0, 0],
            fontSize: 12,
            fillColor: '#2fa512',
            color: 'white',
          },
          titleHead: {
            bold: true,
            border: [false, false, false, false],
            fontSize: 16,
            margin: [0, 20, 0, 0],
            background: '#2fa512',
            color: 'white',
          },
          tableCell: {
            fontSize: 13,
          },
        },
        defaultStyle: {
          fontSize: 11,
          columnGap: 20,
          font: 'Montserrat',
        },
      };
    },
    generatePDF() {
      pdfMake.createPdf(this.getPdfDefinition()).download();
    },
    embedPDF() {
      let self = this;
      // let fexts = {pdf: 'application/pdf', jpg: 'image/jpeg', png: 'image/png'}
      // console.log(this.getPdfDefinition())
      const pdfDocGenerator = pdfMake.createPdf(this.getPdfDefinition());
      pdfDocGenerator.getDataUrl((dataUrl) => {
        const targetElement = document.querySelector('#pdfContainer');
        while (targetElement.firstChild) {
          targetElement.removeChild(targetElement.firstChild);
        }
        const iframe = document.createElement('iframe');
        iframe.src = dataUrl;
        targetElement.appendChild(iframe);
        self.dataLoading = false;
      });
    },
  },
};
</script>

<style>
.bold {
  font-weight: bold;
}
.pdfContainer iframe {
  margin-top: 0px;
  margin-bottom: 0px;
  width: 100%;
  height: 700px;
  border-width: 1px;
  border-style: dashed;
  border-color: initial;
  border-image: initial;
}
</style>
